<script>

var name;

$(".rename").click(function () {
    if (!confirm("DO?"))
        return;
        
    $.ajax({
        url: "http://192.168.0.2/sandbox/api/comics/rename"
      , method: "post"
    });
});

$(".page").click(function () {
    $(".dialog-wrapper").removeClass("hidden");
    name = $(this).data("name");
});

$(".del").click(function () {
    $.ajax({
        url: "http://192.168.0.2/sandbox/api/comics/del?name=" + name
      , method: "post"
    });
    $(".dialog-wrapper").addClass("hidden");
});

$(".inc").click(function () {
    $.ajax({
        url: "http://192.168.0.2/sandbox/api/comics/inc?name=" + name
      , method: "post"
    });
    $(".dialog-wrapper").addClass("hidden");
});

$(".dialog-wrapper").click(function () {
    $(".dialog-wrapper").addClass("hidden");
});

</script>
